import React, { Component } from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';
import Nav from './components/Nav';
import Home2 from './components/Home2';
import About2 from './components/About2';
import Contact2 from './components/Contact2';
import ProjectDetail from './components/ProjectDetail';
import ParticlesComponent from './components/ParticlesComponent';

import './styles/base.scss';

// const logo = require('./images/sass_logo.png');//for reusability

class App extends Component {
  render() {
    return (
    <Router>
      <div
        style={{
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%"
        }}
      >
        <ParticlesComponent />
        <div
          style={{
            position: "absolute",
            top: 0,
            left: 0,
            width: "100%",
            height: "100%"
          }}
        >
          {/* You can render <Route> and <NavTabs /> here */}
          <Nav/>        
          <Switch>
              <Route exact path='/' component={Home2} />
              <Route path='/contact' component={Contact2} />
              <Route path='about/:project' component={About2} />
              <Route path="/link/:id" component={ProjectDetail}/>
          </Switch>
        </div>
      </div>
    </Router>
    );
  }
}

export default App;
